import * as React from 'react';

const Dashboard: React.FC = () => {
  // Hedef tarih örneği: 15 Haziran 2025
  const targetDate = new Date('2025-06-15');
  const today = new Date();
  const daysLeft = Math.ceil((targetDate.getTime() - today.getTime()) / (1000 * 60 * 60 * 24));

  return (
    <div style={{ padding: '24px', maxWidth: 800, margin: '0 auto' }}>
      <h2>Hoş Geldin!</h2>
      <div style={{ marginBottom: 24, background: '#e3f2fd', padding: 16, borderRadius: 8, color: '#1976d2', fontWeight: 500 }}>
        Hedef sınavına <span style={{ fontWeight: 700 }}>{daysLeft}</span> gün kaldı! Başarıya ulaşmak için planlı çalışmaya devam et.
      </div>
      <div style={{ display: 'flex', gap: 16, flexWrap: 'wrap', marginBottom: 24 }}>
        <div style={{ flex: 1, minWidth: 180, background: '#fff', borderRadius: 8, boxShadow: '0 1px 4px #eee', padding: 16 }}>
          <div style={{ fontSize: 18, color: '#1976d2', fontWeight: 600 }}>Toplam Çalışılan Gün</div>
          <div style={{ fontSize: 28, fontWeight: 700 }}>24</div>
        </div>
        <div style={{ flex: 1, minWidth: 180, background: '#fff', borderRadius: 8, boxShadow: '0 1px 4px #eee', padding: 16 }}>
          <div style={{ fontSize: 18, color: '#1976d2', fontWeight: 600 }}>Çözülen Soru</div>
          <div style={{ fontSize: 28, fontWeight: 700 }}>3200</div>
        </div>
        <div style={{ flex: 1, minWidth: 180, background: '#fff', borderRadius: 8, boxShadow: '0 1px 4px #eee', padding: 16 }}>
          <div style={{ fontSize: 18, color: '#1976d2', fontWeight: 600 }}>En İyi Gün</div>
          <div style={{ fontSize: 20, fontWeight: 700 }}>18 Nisan 2025</div>
        </div>
      </div>
      <div style={{ background: '#f5f5f5', padding: 16, borderRadius: 8, color: '#333' }}>
        <strong>Kısa Özet:</strong> Bugün 120 soru çözdün, 3 saat çalıştın. Hedefe ulaşmak için bu tempoyu sürdür!<br/>
        <span style={{ color: '#1976d2' }}>Hızlı erişim:</span> <span> <a href="/study-plan" style={{ color: '#1976d2', textDecoration: 'underline' }}>Çalışma Planı</a> | <a href="/statistics" style={{ color: '#1976d2', textDecoration: 'underline' }}>İstatistikler</a> | <a href="/exam-tracker" style={{ color: '#1976d2', textDecoration: 'underline' }}>Sınav Takibi</a></span>
      </div>
    </div>
  );
};

export default Dashboard;
